import * as React from 'react';
import { Button, View, Text, StyleSheet } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

// import Icon from 'react-native-fa-icons';

import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome'
import { faMugSaucer } from '@fortawesome/free-solid-svg-icons/faMugSaucer'

export default function HomeScreen({ navigation }) {
  return (
    <View style={styles.feed}>
      <View style={styles.card}>
        {/* <Icon name="address-book" style={{ fontSize: 45, color: 'green' }} /> */}
        <FontAwesomeIcon icon={ faMugSaucer } size={ 32 }/>
        <FontAwesomeIcon icon="arrows-up-down-left-right" transform="shrink-6 left-4" />
  <FontAwesomeIcon icon="arrow-right" transform={{ rotate: 42 }} />
        <Text>Indoor Gyms</Text>
      </View>
      <View style={styles.card}>
        <Text>Outdoor Spots</Text>
      </View>
      <View style={styles.card}>
        <Text>Ice & Mix</Text>
      </View>
      <View style={styles.card}>
        <Text>Mountain routes</Text>
      </View>
      <View style={styles.card}>
        <Text>Other Activity</Text>
      </View>
      <View style={styles.card}>
        <Text>Events</Text>
      </View>

      <View style={styles.about_us_card}>
        <Button
          title="Go to Details"
          onPress={() => navigation.navigate('aboutUs')}
        />
        <Text>About us</Text>
      </View>


      <View style={styles.about_us_card}>
        <Button
          title="Workouts"
          onPress={() => navigation.navigate('aboutUs')}
        />
        <Text>Workout</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  feed: {
    flex: 1,
    flexDirection: 'row',
    flexWrap: 'wrap',
    padding: 16,
    justifyContent: 'space-between'  
  },

  card: {
    backgroundColor: 'white',
    width: '48%',
    height: '48%',
    aspectRatio: 1,
    marginBottom: 16   
  },

  about_us_card: {
    backgroundColor: 'white',
    width: '68%',
    height: '68%',
    aspectRatio: 1,
    alignItems: 'center',
    marginBottom: 16  
  }
});
